    TreeNode* sortedArraySegToBST(vector<int>& nums, int start, int end) {
        if (start == end) {
            return new TreeNode(nums[start]);
        }

        if (start > end) {
            return nullptr;
        }

        int rootIndex = (end - start) / 2 + start;
        TreeNode* root = new TreeNode(nums[rootIndex]);
        cout << "root : " << root->val << endl;
        root->left = sortedArraySegToBST(nums, start, rootIndex - 1);
        cout << "root->left : " << root->left << endl;
        root->right = sortedArraySegToBST(nums, rootIndex + 1, end);
        cout << "root->right : " << root->right << endl;
        return root;
    }


    TreeNode* sortedArrayToBST(vector<int>& nums) {
        if (nums.empty()) {
            return nullptr;
        }

        return sortedArraySegToBST(nums, 0, nums.size() - 1);
    }

