class Solution0111 {
public:
    int minDepth(TreeNode* root) {
        if (root == nullptr) {
            return 0;
        }

        if (root->left == nullptr && root->right == nullptr) {
            return 1;
        }

        int minDepthValue = INT_MAX;
        if (root->left != nullptr) {
            minDepthValue = min(minDepth(root->left), minDepthValue);
        }
        if (root->right != nullptr) {
            minDepthValue = min(minDepth(root->right), minDepthValue);
        }

        return minDepthValue + 1;
    }
};

