class Solution0637 {
public:
    vector<double> averageOfLevels(TreeNode* root) {
        vector<double> ans;
        if (!root) {
            return ans;
        }

        queue<TreeNode*> q;
        q.push(root);
        while (!q.empty()) {
            int size = q.size();
            int levelSize = size;
            double levelSum = 0.0;
            while (size > 0) {
                TreeNode* curNode = q.front();
                q.pop();
                // cout << curNode->val << endl;
                levelSum += curNode->val;
                if (curNode->left) {
                    q.push(curNode->left);
                }

                if (curNode->right) {
                    q.push(curNode->right);
                }
                --size;
            }
            ans.push_back(levelSum / levelSize);
        }
        return ans;
    }

    void Test2() {
        TreeNode* q =  new TreeNode(10);
        q->left = new TreeNode(2);
        q->right = new TreeNode(13);
        q->right->right =  new TreeNode(24);
        q->right->left =  new TreeNode(12);
        q->left->right = new TreeNode(2);
        for (double d: averageOfLevels(q)) {
            cout << d << ", ";
        }
        cout << endl;
    }
};

class Solution0653 {
public:
    void preoderTraversal(TreeNode* root, vector<TreeNode*>& nums) {
        if (!root) {
            return;
        }

        preoderTraversal(root->left, nums);
        nums.push_back(root);
        preoderTraversal(root->right, nums);
    }

    bool findNumInTree(TreeNode* root, int num, const TreeNode* n) {
        if (!root) {
            return false;
        }

        if (root->val == num && root != n) {
            return true;
        } else if (num < root->val) {
            return findNumInTree(root->left, num, n);
        } else {
            return findNumInTree(root->right, num, n);
        }
    }

    bool findTarget(TreeNode* root, int k) {
        vector<TreeNode*> nums;
        preoderTraversal(root, nums);
        for (TreeNode* num: nums) {
            if (findNumInTree(root, k - num->val, num)) {
                return true;
            }
        }

        return false;
    }

    void Test2() {
        TreeNode* q =  new TreeNode(1);
        cout << findTarget(q, 2) << endl;
        return;

        q->left = new TreeNode(2);
        q->right = new TreeNode(13);
        q->right->right =  new TreeNode(24);
        q->right->left =  new TreeNode(12);
        q->left->right = new TreeNode(3);
        cout << findTarget(q, 13) << endl;
    }
};

