class Solution0700 {
public:

    TreeNode* searchBST(TreeNode* root, int val) {
        if (!root) {
            return nullptr;
        }

        if (val == root->val) {
            return root;
        }

        if (val < root->val) {
            return searchBST(root->left, val);
        }

        if (val > root->val) {
            return searchBST(root->right, val);
        }

        return nullptr;
    }
};


class KthLargest {
private:
    int maxSize_ = 0;
    priority_queue<int, vector<int>, greater<int>> pq_ = {};
public:
    KthLargest(int k, vector<int>& nums) {
        this->maxSize_ = k;
        for (int n: nums) {
            add(n);
        }

    }

    int add(int val) {
        pq_.push(val);

        // cout << "push: " << val << endl;
        // cout << "pq size : " << pq_.size() << endl;
        if (pq_.size() > this->maxSize_) {
            // cout << "pop: " << pq_.top() << endl;
            pq_.pop();
        }
        return pq_.top();
    }

    void Test() {
        // [null, 4, 5, 5, 8, 8]
        cout << "rst: " << this->add(3) << endl;
        cout << "rst: " << this->add(5) << endl;
        cout << "rst: " << this->add(10) << endl;
        cout << "rst: " << this->add(9) << endl;
        cout << "rst: " << this->add(4) << endl;
    }
};

class Solution00872 {
public:
    void getLeaves(TreeNode* root, vector<int>& nums) {
        if (!root) {
            return;
        }

        if (!root->left && !root->right) {
            nums.push_back(root->val);
        }

        if (root->left) {
            getLeaves(root->left, nums);
        }
        if (root->right) {
            getLeaves(root->right, nums);
        }
    }

    bool leafSimilar(TreeNode* root1, TreeNode* root2) {
        vector<int> n1 = {};
        getLeaves(root1, n1);
        vector<int> n2 = {};
        getLeaves(root2, n2);
        if (n1.size() != n2.size()) {
            return false;
        }
        for (int i = 0; i < n1.size(); ++i) {
            if (n1[i] != n2[i]) {
                return false;
            }
        }
        return true;
    }

    void Test() {
        TreeNode* p = new TreeNode(1);
        p->left = new TreeNode(2);
        p->right = new TreeNode(4);
        p->right->left = new TreeNode(3);

        TreeNode* q = new TreeNode(1);
        q->left = new TreeNode(2);
        q->right = new TreeNode(4);
        q->right->right = new TreeNode(6);

        cout << leafSimilar(p, q) << endl;
    }
};


