class Solution0235 {
public:
    queue<TreeNode*> findNodeInBST(TreeNode* root, TreeNode* t) {
        TreeNode* curNode = root;
        queue<TreeNode*> ans;

        while (curNode) {
            ans.push(curNode);
            if (t->val < curNode->val) {
                curNode = curNode->left;
            } else if (t->val > curNode->val) {
                curNode = curNode->right;
            } else {
                return ans;
            }
        }

        queue<TreeNode*> b;
        return b;
    }


    TreeNode* lowestCommonAncestora(TreeNode* root, TreeNode* p, TreeNode* q) {
        if (!root) {
            return root;
        }

        if (!p || !q) {
            return nullptr;
        }

        queue<TreeNode*> pPath = findNodeInBST(root, p);
        queue<TreeNode*> qPath = findNodeInBST(root, q);
        TreeNode* lastNode = nullptr;
        while (!pPath.empty() && !qPath.empty()) {
            if (pPath.front() != qPath.front()) {
                break;
            } else {
                lastNode = pPath.front();
            }

            pPath.pop();
            qPath.pop();
        }

        return lastNode;
    }

    TreeNode* lowestCommonAncestor(TreeNode* root, TreeNode* p, TreeNode* q) {
        if (!root) {
            return nullptr;
        }

        if (root == p || root == q) {
            return root;
        }

        TreeNode* left = lowestCommonAncestor(root->left, p, q);
        TreeNode* right = lowestCommonAncestor(root->right, p, q);

        if (left != nullptr && right != nullptr) {
            return root;
        }
        if (left == nullptr && right == nullptr) {
            return nullptr;
        }
        return left != nullptr? left: right;
    }

    void Test() {
        TreeNode* root = new TreeNode(1);
        root->left = new TreeNode(2);
        root->right = new TreeNode(5);
        root ->right->left = new TreeNode(4);
        TreeNode* n = lowestCommonAncestor(root, root->right, root->right->left);
        cout << n->val << endl;
    }
};

class Solution0167 {
public:
    vector<int> twoSum(vector<int>& numbers, int target) {
        int lo = 0;
        int hi = numbers.size() - 1;
        while (lo < hi) {
            // cout << "\t" << lo << "\t" << hi << endl;
            int v = numbers[lo] + numbers[hi];
            if (v == target) {
                return {lo + 1, hi + 1};
            } else if (v > target) {
                --hi;
            } else {
                ++lo;
            }
        }
        return {};
    }

    vector<int> twoSumBS(vector<int>& numbers, int target) {
        for (int i = 0; i < numbers.size() - 1; ++i) {
            int lo = i;
            int hi = numbers.size();
            while (lo < hi) {
                int m = (lo + hi) / 2;
                int sum = numbers[m] + numbers[i];
                if (sum == target) {
                    return {i + 1, m + 1};
                } else if (sum > target) {
                    hi = m;
                } else {
                    lo = m + 1;
                }


            }
            // cout << "No. " << i << "\t" << lo << "\t" << hi << endl;
        }

        return {};
    }
};

