class Solution0057o {
public:
    vector<int> twoSum(vector<int>& nums, int target) {
        long lo = 0;
        long hi = nums.size() - 1;
        while (lo < hi) {
            long v = (long)nums[lo] + nums[hi];
            if (nums[lo] + nums[hi] == target) {
                return {nums[lo], nums[hi]};
            } else if (v > target) {
                --hi;
            } else {
                ++lo;
            }
        }

        return {};
    }
};

