class Codec {
public:

    // Encodes a tree to a single string.
    string serialize(TreeNode* root) {
        queue<TreeNode*> q;
        q.push(root);
        string ans{};
        while (!q.empty()) {
            int sz = q.size();
            int cnt = 0;
            int notNullptr = 0;
            while (cnt < sz) {
                TreeNode* cur = q.front();
                string nodeStr = "null,";
                if (cur) {
                    notNullptr += (cur->left == nullptr ? 0 : 1);
                    notNullptr += (cur->right == nullptr ? 0 : 1);
                    q.push(cur->left);
                    q.push(cur->right);
                    nodeStr = to_string(cur->val);
                    nodeStr.push_back(',');
                }
                ans.append(nodeStr);
                q.pop();
                ++cnt;
            }
            if (notNullptr == 0) {
                break;
            }
        }

        if (!ans.empty()) {
            ans.pop_back();
        }
        return ans;
    }

    vector<string> split22String(const string& src, char delim) {
        int pos = src.find_first_of(',' );
        vector<string> ans;
        if (std::string::npos == pos) {
            ans.push_back(src);
            ans.push_back("");
        } else {
            ans.push_back(src.substr(0, pos - 0));
            ans.push_back(src.substr(pos + 1, src.size() - pos - 1));
        }
        return move(ans);
    }

    TreeNode* getNewNode(const string& valStr) {
        if (valStr.empty()) {
            return nullptr;
        }

        // build node
        stringstream ss;
        int val;
        TreeNode* root = nullptr;
        if (valStr != "null") {
            ss << valStr;
            ss >> val;
            root = new TreeNode(val);
        }

        return root;
    }

    // Decodes your encoded data to tree.
    TreeNode* deserialize(string data) {
        if (data.empty()) {
            return nullptr;
        }

        const vector<string>& firstNode = split22String(data, ',');
        // build node
        TreeNode* root = getNewNode(firstNode[0]);

        queue<TreeNode*> q;
        q.push(root);
        string restData= firstNode[1];
        while (!q.empty()) {
            int sz = q.size();
            int cnt = 0;
            while (cnt < sz) {
                TreeNode* cur = q.front();
                q.pop();
                ++cnt;
                if (!cur) {
                    continue;
                }

                const vector<string>& leftData = split22String(restData, ',');
                cur->left = getNewNode(leftData[0]);
                restData = leftData[1];
                q.push(cur->left);

                const vector<string>& rightData = split22String(restData, ',');
                cur->right = getNewNode(rightData[0]);
                restData = rightData[1];
                q.push(cur->right);
            }
        }
        return root;
    }
};

class Solution0099 {
private:
    TreeNode* preVisitNode = nullptr;
    TreeNode* firstNode = nullptr;
    TreeNode* secondNode = nullptr;
public:
    void dfs(TreeNode* root) {
        if (!root) {
            return;
        }

        dfs(root->left);
        cout << endl << root->val << endl;
        if (preVisitNode && preVisitNode->val > root->val) {
            secondNode = root;
            cout << "secondNode: " << secondNode->val << endl;
            if (!firstNode) {
                firstNode = preVisitNode;
                cout << "firstNode: " << firstNode->val << endl;
            }
        }
        preVisitNode = root;
        dfs(root->right);
    }

    void recoverTree(TreeNode* root) {
        dfs(root);

        if (firstNode) {
            int val = firstNode->val;
            firstNode->val = secondNode->val;
            secondNode->val = val;
        }
    }
};

