class Solution0993 {
public:
    bool isCousins(TreeNode* root, int x, int y) {
        queue<TreeNode*> q{};
        q.push(root);
        map<TreeNode*, TreeNode*> mp{};
        mp[root] = nullptr;
        while (!q.empty()) {
            const int SZ = q.size();
            int cnt = 0;

            TreeNode* xNode = nullptr;
            TreeNode* yNode = nullptr;
            while (cnt < SZ) {
                TreeNode* cur = q.front();
                if (x == cur->val || y == cur->val) {
                    if (!xNode) {
                        xNode = cur;
                    } else {
                        yNode = cur;
                        return mp[xNode] != mp[yNode];
                    }
                }
                if (cur->left) {
                    q.push(cur->left);
                    mp[cur->left] = cur;
                }
                if (cur->right) {
                    q.push(cur->right);
                    mp[cur->right] = cur;
                }
                q.pop();
                ++cnt;
            }
            if (xNode) {
                break;
            }
        }

        return false;
    }
};

